ISLAMABAD, May 24 (APP):Chairman Senate Muhammad Sadiq Sanjrani on Monday announced panel of presiding officers to conduct the proceedings of 311th Senate session in absence of Chairman and Deputy Chairman.
Senate Azam Nazir Tarar, Senator Humanyun Khan and Senator Khalida Ateeb would conduct the proceedings of the Upper House of the Parliament.
